import { useEffect, useState } from "react";

export default function HostCarPhotos() {
    const [car, setCar] = useState(0);
    useEffect(() => {
        const res = JSON.parse(localStorage.getItem("cars"));
        const data = res.filter(c => c.id === "1" && c.hostId === "1");
        setCar(data[0]);
    }, []);
    return (
      <img style={{width: 90, marginTop: 10, borderRadius: 5}} src={car.imageUrl} alt="car avatar" />
    );
};
